import React, { useEffect } from "react";
import { GoogleLogin } from "react-google-login";
import { userActions } from "../../state/actions";
import { useDispatch } from "react-redux";
import { useHistory } from "react-router";

const LoginGoogle = () => {
  const dispatch = useDispatch();
  const history = useHistory();
  const onSuccess = (res) => {
    res.console.log("Login Sucess currentUSer " + JSON.stringify(res));
    const user = {
      name: res.profileObj.name,
      email: res.profileObj.email,
      usersource: "google",
    };
    dispatch(userActions.signUpUser(user));
  };

  const onFailure = () => {
    console.log("Login Fail");
  };
  const value = process.env.REACT_APP_GOOGLE_O_AUTH_CLIENT_ID;
  useEffect({}, [isAuthenticated]);
  return (
    <div className="pb-5">
      <GoogleLogin
        // clientId={process.env.REACT_APP_GOOGLE_O_AUTH_CLIENT_ID}
        clientId={value}
        buttonText="Login this shit"
        onSuccess={onSuccess}
        onFailure={onFailure}
        cookiePolicy={"single_host_origin"}
        className="mt-5"
        isSignedIn={true}
      ></GoogleLogin>
    </div>
  );
};
export default LoginGoogle;
